function Voitures() {

    const voituresComp = [];
for (const voiture of voitures) {
    const { id, nom, annee } = voiture;
    voituresComp.push(<Voitures key={id} nom={nom} annee={annee} />)
}
    return (
        { voituresComp }

    );
}


export default Voitures;
